import {Footer, FooterSection, FooterDropDownSection, FooterLinkList} from "react-mdl"

const Foot = () => {
    return(
        <div className="stick_to_bottom">
                <Footer size="mini" style={{background: "rgb(17, 33, 44)"}}>
                    <FooterSection type="left" logo="Bloom Tailors">
                        <FooterLinkList>
                            <NavLink to="/contact-us" activeClassName="is-active">Contact Us</NavLink>
                            <NavLink to="/terms-of-use" activeClassName="is-active">Terms of Use & Privacy Policy</NavLink>
                        </FooterLinkList>
                    </FooterSection>
                </Footer>
            </div>
    )
}

export default Foot;
